import React from "react";
import ToolBar from "../Components/ToolBar";

class Home extends React.Component {
  render() {
    return (
      <div style={{ display: "flex", flexDirection: "column" }}>
        <ToolBar />
        <h2>Helo World</h2>
      </div>
    );
  }
}

export default Home;
